import React from 'react';
import Mailchimp from 'react-mailchimp-form';

class Dogs extends React.Component {
    render() {
      return (
          <Mailchimp
          action='https://rocks.us15.list-manage.com/subscribe/post?u=645c4a5124c0e6aae7ac2b2f6&amp;id=f78bc0d515'
          fields={[
            {
              name: 'EMAIL',
              placeholder: 'Email',
              type: 'email',
              required: true
            },
            {
                name: 'FNAME',
                placeholder: 'Name',
                type: 'text',
                required: true
              }

          ]}
          />
      );
    }
  }


export default Dogs;
